SELECT HL7DataStructures.data_structure FROM (HL7Versions INNER JOIN HL7DataStructures ON HL7Versions.version_id = HL7DataStructures.version_id) INNER JOIN HL7DataStructureComponents ON (HL7DataStructures.version_id = HL7DataStructureComponents.version_id) AND (HL7DataStructures.data_structure = HL7DataStructureComponents.data_structure) WHERE (((HL7Versions.hl7_version)= ? ) AND ((HL7DataStructures.elementary) = No)) ORDER BY HL7DataStructures.data_structure
